import React from 'react'

function Alert() {
    return (
        <div class="alert alert-primary d-flex align-items-center" role="alert">
            <svg class="bi flex-shrink-0 me-2" role="img" aria-label="Info:"></svg>
            <div>
                An example alert with an icon
            </div>
        </div>
    )
}

export default Alert
